import React from 'react';
import { Container, Typography, Box, Grid, Paper } from '@mui/material';
import { styled } from '@mui/material/styles';

// Styled components
const ServiceCategory = styled(Paper)(({ theme }) => ({
  minHeight: 400,
  padding: theme.spacing(3),
  textAlign: 'left',
  width: '100%',
  maxWidth: 'calc(20% - 20px)',
}));

const GridItem = styled(Grid)(({ theme }) => ({
  flexBasis: 'calc(20% - 20px)',
  maxWidth: 'calc(20% - 20px)',
}));

const EyelashExtensionPage = () => {
  return (
    <Container className="container">
      <Box mt={4} mb={4}>
        <Typography variant="h2" align="center">Eyelash Extensions</Typography>

        {/* Services Price Chart */}
        <Grid container spacing={4} mt={4} justifyContent="center">
          <Grid item xs={12} sm={6} md={3} component={GridItem}>
            <ServiceCategory elevation={3}>
              <Typography variant="h5" align="center" gutterBottom>
                Eyelash Extensions
              </Typography>
              <Box p={4} textAlign="left">
                <Typography variant="body1">Classic Full Set - $120</Typography>
                <Typography variant="body1">Volume Full Set - $150</Typography>
                <Typography variant="body1">Hybrid Full Set - $135</Typography>
                <Typography variant="body1">Classic Fill - $60</Typography>
                <Typography variant="body1">Volume Fill - $75</Typography>
                <Typography variant="body1">Hybrid Fill - $70</Typography>
              </Box>
            </ServiceCategory>
          </Grid>

          {/* Add more items here as needed */}
        </Grid>
      </Box>
    </Container>
  );
};

export default EyelashExtensionPage;
